import React from "react";


export const Signup = () => {

    const [isLoginVisible, setIsLoginVisible] = useState(false);

    const handleCardSwitch = () => {
        setIsLoginVisible(!isLoginVisible);
    };

    return(
        <div className="flex justify-center items-center h-screen bg-offwhite">
      <div className="w-96 rounded-md shadow-lg bg-white">
        <div className="flex justify-between items-center p-4">
          <h2 className="text-2xl font-bold text-black">
            {isLoginVisible ? 'Login' : 'Signup'}
          </h2>
          <button
            className="text-sm text-black underline focus:outline-none"
            onClick={handleCardSwitch}
          >
            {isLoginVisible ? 'Click here to signup!' : 'I already have an account'}
          </button>
        </div>
        <div className="p-4">
          {isLoginVisible ? (
            <LoginForm handleCardSwitch={handleCardSwitch} />
          ) : (
            <SignupPrompt handleCardSwitch={handleCardSwitch} />
          )}
        </div>
      </div>
    </div>
  );
};

const LoginForm = ({ handleCardSwitch }) => {
  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle login form submission
  };

  return (
    <form onSubmit={handleSubmit}>
      {/* Login form fields */}
      <div className="mb-4">
        <label htmlFor="email" className="block text-sm text-black font-bold mb-2">
          Email
        </label>
        <input
          type="email"
          id="email"
          className="w-full px-3 py-2 rounded bg-gray-100 border border-gray-300 focus:outline-none"
          required
        />
      </div>
      <div className="mb-4">
        <label htmlFor="password" className="block text-sm text-black font-bold mb-2">
          Password
        </label>
        <input
          type="password"
          id="password"
          className="w-full px-3 py-2 rounded bg-gray-100 border border-gray-300 focus:outline-none"
          required
        />
      </div>
      <div className="flex justify-between">
        <button
          type="submit"
          className="bg-black text-white px-4 py-2 rounded hover:bg-gray-800 focus:outline-none"
        >
          Login
        </button>
        <button
          className="text-sm text-black underline focus:outline-none"
          onClick={handleCardSwitch}
        >
          Click here to signup!
        </button>
      </div>
    </form>
  );
};

const SignupPrompt = ({ handleCardSwitch }) => {
  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle signup form submission
  };

  return (
    <form onSubmit={handleSubmit}>
      {/* Signup form fields */}
      <div className="mb-4">
        <label htmlFor="name" className="block text-sm text-black font-bold mb-2">
          Name
        </label>
        <input
          type="text"
          id="name"
          className="w-full px-3 py-2 rounded bg-gray-100 border border-gray-300 focus:outline-none"
          required
        />
      </div>
      <div className="mb-4">
        <label htmlFor="email" className="block text-sm text-black font-bold mb-2">
          Email
        </label>
        <input
          type="email"
          id="email"
          className="w-full px-3 py-2 rounded bg-gray-100 border border-gray-300 focus:outline-none"
          required
        />
      </div>
      <div className="mb-4">
        <label htmlFor="password" className="block text-sm text-black font-bold mb-2">
          Password
        </label>
        <input
          type="password"
          id="password"
          className="w-full px-3 py-2 rounded bg-gray-100 border border-gray-300 focus:outline-none"
          required
        />
      </div>
      <div className="flex justify-between">
        <button
          type="submit"
          className="bg-black text-white px-4 py-2 rounded hover:bg-gray-800 focus:outline-none"
        >
          Signup
        </button>
        <button
          className="text-sm text-black underline focus:outline-none"
          onClick={handleCardSwitch}
        >
          I already have an account
        </button>
      </div>
    </form>
    )
}

export default Signup;
